import { FormControl, FormLabel, Input } from "@chakra-ui/react";
import React from "react";

const SignUp = () => {
  return (
    <VStack spacing={4}>
      <FormControl>
        <FormLabel></FormLabel>
        <Input> </Input>
      </FormControl>
    </VStack>
  );
};

export default SignUp;
